import React from 'react';
import { useDispatch } from 'react-redux';
import { delCart } from 'store/ducks/shop';

import './styles.scss';

export default function CartElement(props){

    const dispatch = useDispatch();

    const delCartItem = () => {
        dispatch(delCart(props.name))
    }

    return(
        <>
            <div className="cart-el">
                <img className="cart-el--img"
                    src={"https://ikebana-app-content.s3-sa-east-1"+
                    ".amazonaws.com/Ikebana_-_Yoshiko_Nakamura_01B.jpg"} 
                    alt="Planta" />
                <p className="cart-el--name">{props.name}</p>
                <button onClick={delCartItem} 
                    className="cart-el--delete">
                    <i style={{color: "red"}} 
                    className="material-icons">delete</i>
                </button>
            </div>
        </>
    );
}
